        paramJson.put("jsonObjectList", jsonArray.toJSONString());
修改为
        paramJson.put("jsonObject", jsonObject);
        paramJson.put("jsonArray", jsonArray);
        paramJson.put("jsonObjectList", jsonArray);

```

